import React from 'react';
import styled from 'styled-components';

const RibbonHolder = styled.div`
  width: 50px;
  height: 50px;
  background: red;
  position: relative;
  top: -10px;
  right: -10px;
`;

const RibbonBody = styled.span`
  width: 200px;
  padding: 15px 0px;
  background: blue;
  display: block;
  position: relative;
  top: 30px;
  left: -25px;
  transform: rotate(45deg);
`;

const Ribbon = () => {
  return <RibbonHolder></RibbonHolder>;
};

export default Ribbon;
